import { Container } from 'react-bootstrap';

function ImgContainer() {
    return (
        <Container>
            <div class="d-flex flex-wrap justify-content-center box-container" id="img_container">
                <p className='text-primary'>IMG</p>
            </div>
        </Container>
    );
};

export default ImgContainer;
